import React from 'react';
import {Grid} from '@material-ui/core';

import Product from './Product';
import useStyles from './styles';
const products = [
    { id: 1, name: 'tshirt', description: 'Jahn Dough tshirt', price: '$25'},
    { id: 2, name: 'hoodie', description: 'Jahn Dough hoodie',price: '$45'},
    { id: 3, name: 'lighter', description: 'Jahn Dough lighter',price: '$1'}

];

const Products = () => {
    const classes = useStyles();

    return(

        <main className={classes.content}>
        <Grid container justify="center" spacing={14}>
            {products.map((product) => (
                <Grid item key={product.id} xs={12} sm={6} md={4} lg={3}> 
                <Product product={product}/> 
                </Grid>
            ))}
        </Grid>

    </main>
    )


}
export default Products;
